const LoginBox = () => {
    return(
        <div className="container">

                <h2>Login</h2>
                <button>
                    login
                </button>

            <style jsx>
                {
                    `
                    .container {
                        background: var(--neomorphic-white);
                        width: 350px;
                        height: 450px;
                        box-shadow: 0px 0px 25px 5px rgba(0,0,0,0.2);
                        padding: 30px 10px;
                        border-radius: 10px;
                        display: flex;
                        flex-direction: column;
                        align-items: center;
                        box-shadow: var(--neomorphic-box-shadow);
                        
                    }

                    .container h2 {
                        font-weight: 900;
                        text-transform: uppercase;
                        font-size: 1rem;
                        text-align: center;
                        margin-bottom: 30px;
                    }

                    .container button {
                        width: 70%;
                        height: 40px;
                        text-transform: uppercase;
                        border: none;
                        outline: none;
                        cursor: pointer;
                        font-size: 0.7rem;
                        font-weight: 900;
                        box-shadow: var(--neomorphic-box-shadow);
                        background: var(--neomorphic-white);
                        color: black;
                        border-radius: 50px;
                        transition: all 0.3s linear;
                        position: absolute;
                        bottom: 15px;
                        left: 50%;
                        transform: translateX
                    }
                    
                    .container button:hover {
                        box-shadow: var(--hover-neomorphic-box-shadow);
                    }
                    
                    `
                }
            </style>
        </div>
    )
}

export default LoginBox;
